import Cards from '../../componenents/loopings/cards';
import Carousel from '../../componenents/loopings/carousel';
import Promo from '../../componenents/promo/promo';
import Fliper from '../../componenents/loopings/fliped';
import Team from '../../componenents/section/team';
import Footer from '../../componenents/footer';
import Nav from '../../componenents/nav';
import Header from '../../componenents/section/header';
import Flutuante from '../../componenents/micros/flutter';
import ScrollTop from '../../componenents/micros/scrollTop';
import Alert from '../../componenents/micros/alert';
import HandleVisibility from '../../componenents/observer/Visibility';
import Observer from '../../componenents/observer';
export default function Home() {
  return (
    <div className="App">
      <Promo />
      <Nav />
      <Alert />

      <Observer>
        <Team handleVisibility={HandleVisibility} />
      </Observer>
      <Observer>
        <Carousel handleVisibility={HandleVisibility} />
      </Observer>
      <Observer>
        <Fliper handleVisibility={HandleVisibility} />
      </Observer>
      <Observer>
        <Cards handleVisibility={HandleVisibility} />
      </Observer>
      <Observer>
        <Header handleVisibility={HandleVisibility} />
      </Observer>
      <Footer handleVisibility={HandleVisibility} />

      <Flutuante />
      <ScrollTop />
    </div>
  );
}
